import React from 'react';

export default function Header() {
    return (
        <div className='w-full fixed top-0 left-0'>
            <div className='mx-auto bg-white h-16 flex items-center max-w-4xl px-4'>
                {/* 변경된 부분: 글자 크기와 두께를 지정하는 클래스 대신 직접 스타일로 지정 */}
                <p style={{ fontSize: '20px', fontWeight: '700' }}>기업해외 출장 보험</p>
                <div className='ml-auto'>
                    <ul className='flex space-x-8'>
                        <li className='li_hover'>보험료 예시</li>
                        <li className='li_hover'>상품정보</li>
                        <li className='li_hover'>담보 및 보상한도</li>
                        <li className='li_hover'>Q & A</li>
                    </ul>
                </div>
            </div>
        </div>
    );
}
